import Button from 'react-bootstrap/Button';
import { useEffect } from "react";
import GetModelImageData from '../utils/GetModelImageData';

const SurveyPart3 = () => {
    var userData = undefined;
    var modelData = GetModelImageData();

    useEffect(() => {
        if(sessionStorage.getItem('questionaireData') == null) {
            userData = ["",""];
            window.sessionStorage.setItem('questionaireData', JSON.stringify(userData));
        }
        else {
            userData = JSON.parse(window.sessionStorage.getItem('questionaireData'));
            
        }
        setTextAreaData();       
      },[])

      function Next() {
        saveData();
        document.getElementById("SurveyPart3").style.display = "none";
        document.getElementById("SurveyPart4").style.display = "inline";       
    }

    function Previous() {
        saveData();
        document.getElementById("SurveyPart2").style.display = "inline";
        document.getElementById("SurveyPart3").style.display = "none";
    }

    function saveData() {
        userData[0] = document.getElementById("areaOne").value;
        userData[1] = document.getElementById("areaTwo").value;
        window.sessionStorage.setItem('questionaireData', JSON.stringify(userData));
    }

    function setTextAreaData() {
        document.getElementById("areaOne").value = userData[0];
        document.getElementById("areaTwo").value =  userData[1];
    }

    return (
        <div id="SurveyPart3">
            <div>
                <h1>Del 3</h1>
                <h4>Frågor</h4>
                <br>
                </br>
                <br>
                </br>
            </div>
            <div className="row">
                <div style={{float: "left", width: "50%"}}>
                    <div id="A" className="ModelDiv">
                    <h2 style={{display: "inline"}}>A</h2>     
                    <img src={modelData[0][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[1][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[2][1]} style={{marginLeft: "10px"}}></img>        
                    </div>
                    <br>
                    </br>
                    <div id="B" className="ModelDiv">
                    <h2 style={{display: "inline"}}>B</h2>    
                    <img src={modelData[3][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[4][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[5][1]} style={{marginLeft: "10px"}}></img>                          
                    </div>
                    <br>
                    </br>
                    <div id="C" className="ModelDiv">
                    <h2 style={{display: "inline"}}>C</h2>    
                    <img src={modelData[6][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[7][1]} style={{marginLeft: "10px"}}></img>
                    <img src={modelData[8][1]} style={{marginLeft: "10px"}}></img>  
                    <br>
                    </br>
                    <br>
                    </br>            
                    </div>
                    <div>
                        <i>Håll muspekaren över en bild för att se den i större skick</i>
                    </div>
                </div>
                <div style={{float: "left", width: "50%"}}>
                    <div style={{textAlign: "right"}}>
                        <label>På vilka sätt påverkas din tillit till systemet av tillgången visualiseringar likt de till vänster, som visar vad som mest påverkade identifieringen?</label>
                        <textarea id="areaOne"></textarea>  
                        <br>
                        </br>            
                        <label>Vad tycker du är viktigast i visualiseringarna för att kunna avgöra om systemet är pålitligt eller inte?</label>
                        <textarea  id="areaTwo"></textarea>     
                        <br>
                        </br>
                        <br>
                        </br>
                        <Button id="Previous-button-part3" style={{ marginBottom: "20px", marginRight: "20px", width: "80px"}} variant="outline-secondary" onClick={Previous}>Tillbaka</Button>
                        <Button id="Next-button-part3" style={{ marginBottom: "20px", marginLeft: "20px", width: "80px"}} variant="outline-secondary"onClick={Next}>Färdig</Button>       
                    </div>
                </div>
            </div>     
        </div>          
    )
}

export default SurveyPart3;
